import React, { useState, useEffect } from "react";
import { View, Text, StyleSheet, FlatList, TouchableOpacity, Image, Button } from 'react-native'
import { useTheme } from '../contexts/theme';
import { useLanguage } from '../contexts/language'
import DatePicker from 'react-native-date-picker'
import moment from "moment";
import axios from 'axios';
import Loader from '../components/loader'

export default function ChooseDoctor({ navigation, route }) {
    const { currentTheme } = useTheme();
    const { strings } = useLanguage()

    const speciality = (route && route.params && route.params.speciality) || undefined

    console.log('Speciality Selected------>', speciality);

    const [date, setDate] = useState(new Date())
    const [open, setOpen] = useState(false)
    const [doctorsList, setDoctorsList] = useState([])
    const [loading, setLoading] = useState(true)

    useEffect(() => {
        getDoctorsList(date)
    }, [])

    async function getDoctorsList(date) {
        try {
            const selectedDate = moment(date).format('YYYY-MM-DD')
            const selectedSpeciality = speciality?.uniqueIdentifier
            setLoading(true)
            // Set your API endpoint
            const apiUrl = `https://test-api.bupa.com.sa/bupa-organization/point/careconnectapi/api/availableDoctors?date=${selectedDate}&speciality=${selectedSpeciality}`;
            // Define your headers
            const headers = {
                'Content-Type': 'application/json',
               // 'Authorization': 'Bearer 1234',
                'X-IBM-Client-Id': 'ff2c78972b6d1ee0efb2e07a128ef1fe',
                'X-IBM-Client-Secret': '9f38c7a03dfaf209b41bedb011e15064'
            };
            const response = await axios.get(apiUrl, { headers });
            console.log('Get Doctors List------->', JSON.stringify(response?.data));
            setDoctorsList(response?.data)
            setLoading(false)
        } catch (error) {
            setDoctorsList([])
            setLoading(false)
            console.log('Get Doctors List Error------->', error);
        }
    }

    const doctorCard = (data) => {
        return (
            <View style={{ width: '90%', alignSelf: 'center', marginTop: 5, marginBottom: 10 }}>
                <TouchableOpacity
                    style={[styles.cardItem, { backgroundColor: currentTheme?.primaryCard }]}
                    onPress={() => {
                        navigation.navigate('Book Appointment', {
                            details: {
                                speciality: speciality,
                                doctorDetails: data,
                                selectedDate: date
                            }
                        })
                    }}
                    activeOpacity={0.9}
                >
                    <View style={{ flexDirection: 'row', width: '100%' }}>
                        <View>
                            <Image
                                style={styles.tinyLogo}
                                source={{ uri: `data:image/jpeg;base64,${""}` }}
                            />
                        </View>
                        <View style={{ marginLeft: 20, width: '70%' }}>
                            <Text style={styles.doctorTitleText}>{data?.firstNameEn + " " + data?.lastNameEn}</Text>
                            <Text style={styles.doctorSpecialityText}>{data?.speciality?.name}</Text>
                            <Text style={{
                                fontSize: 14
                            }}>{data?.experience + " " + data?.experienceUnit}</Text>
                        </View>
                    </View>
                    <View style={{ flexDirection: 'row', width: '100%', marginTop: 10, justifyContent: 'space-between', alignItems: 'center' }}>
                        <Image
                            style={{ marginLeft: 15, width: 30, height: 30, resizeMode: 'contain' }}
                            source={require('../assets/calendar.png')} />
                        <Text style={styles.doctorExperianceText}>{'Available on ' + moment(data?.date).format("Do MMMM, YYYY h:mm A")}</Text>
                    </View>
                </TouchableOpacity>
            </View>
        )
    }

    return (
        <View style={{ flex: 1 }}>
            <View style={{ marginTop: 10, marginBottom: 5, alignSelf: 'center' }}>
                <Text style={[styles.chooseSpecialityText, { color: currentTheme?.primaryText }]}>{`${strings['label.chooseADoctor']}`}</Text>
                <Text style={[styles.selectSpecialityText, { color: currentTheme?.primaryText }]}>{`${strings['label.bookDoctor']}`}</Text>
                <Text style={[styles.selectSpecialityText, { color: currentTheme?.primaryText }]}>{`${strings['label.perMonthConsultations']}`}</Text>
            </View>
            <View style={{
                width: '100%',
                justifyContent: 'center',
                flexDirection: 'row',
                alignItems: 'center',
                marginBottom: 10
            }}>
                <Text style={[styles.selectSpecialityText, { color: currentTheme?.primaryText, fontSize: 16, marginBottom: 0 }]}>
                    {'Selected Date: ' + moment(date).format('Do MMMM, YYYY')}
                </Text>
                <TouchableOpacity
                    onPress={() => setOpen(true)}>
                    <Image
                        style={{ marginLeft: 15, width: 30, height: 30, resizeMode: 'contain' }}
                        source={require('../assets/calendar.png')} />
                </TouchableOpacity>
            </View>
            <DatePicker
                modal
                open={open}
                date={date}
                // minimumDate={new Date()}
                onConfirm={(date) => {
                    setOpen(false)
                    setDate(date)
                    getDoctorsList(date)
                }}
                onCancel={() => {
                    setOpen(false)
                }}
            />
            {loading && <Loader />}
            {doctorsList.length && !loading ?
                <FlatList
                    data={doctorsList}
                    showsVerticalScrollIndicator={true}
                    renderItem={({ item }) => doctorCard(item)}
                    keyExtractor={item => item.id}
                />
                :
                <View style={{ flex: 1, marginTop: 100, justifyContent: 'flex-start', alignItems: 'center' }}>
                    <Image
                        style={{ width: 150, height: 150, resizeMode: 'contain' }}
                        source={require('../assets/no-results.png')} />
                    <Text
                        style={[styles.selectSpecialityText, { color: currentTheme?.primaryText, marginTop: 10 }]}>
                        {`${strings['label.noDoctors']}`}
                    </Text>
                </View>
            }
        </View>
    );
}

const styles = StyleSheet.create({
    chooseSpecialityText: {
        fontWeight: '900',
        fontSize: 20,
        textAlign: 'center',
        marginBottom: 10
    },
    selectSpecialityText: {
        fontSize: 15,
        textAlign: 'center',
        marginBottom: 10
    },
    specialityListText: {
        fontSize: 15,
        fontWeight: '900',
        marginLeft: 20,
        marginBottom: 10
    },
    box: {
        marginTop: 10,
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        alignSelf: 'center',
        borderWidth: 1,
        borderRadius: 10,
        borderColor: '#1279BE',
        padding: 10,
        width: '85%',
    },
    doctorTitleText: {
        fontSize: 16,
        fontWeight: '900'
    },
    doctorSpecialityText: {
        fontSize: 14
    },
    doctorExperianceText: {
        fontSize: 16,
        width: '80%'
    },
    tinyLogo: {
        width: 60,
        height: 60,
        borderRadius: 30,
        justifyContent: 'center',
        alignItems: 'center',
    },
    cardItem: {
        shadowColor: 'black',
        shadowOffset: { width: 0, height: 2 },
        shadowRadius: 6,
        shadowOpacity: 0.26,
        elevation: 8,
        padding: 10,
        borderRadius: 5,
    }
})